import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
//-------------Componentes-------------//
import Navbar from './Components/Navbar';
import Comp1 from './Components/Componente1';
import Comp2 from './Components/Componente2';
import { Footer } from './Components/Footer';
import Wsp from './Components/WhatsappPNG';
import Copyri from './Components/Copyri';
//-------------StyleSheet-------------//
import "./style.css";
import "./wsp.css";
import "./Botons.css"
import Contact from './Components/Contact';

const HOME = props =>{
  /* eslint-disable */
  return(
      <Router>
      <header>
          <div className="company-logo" >
              
              LongDino
          </div>
          <nav className="navbar">
          <ul className="nav-items">
              <li className="nav-item">
                  <a href="www.google.com" className="nav-link">
                      <Link to="/">HOME</Link>
                  </a>
              </li>
              <li className="nav-item">
                  <a href="https://api.whatsapp.com/send?phone=+56936681029&text=Hola, Quisiera hacer unas consultas."  target="_blank" rel="noreferrer" className="nav-link">
                      <Link to="/Contact">CONTACT</Link>
                  </a>
              </li>
          </ul>
          </nav>
          <div className="menu-toggle">
          <i className="bx bx-menu"></i>
          <i className="bx bx-x"></i>
          </div>
          
      </header>
      <div className="linetop"></div>
      </Router>
  );
}
const CONTACT = props =>(
  <>
    <HOME/>
    <Contact/>
  </>
)



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
    <Routes>
        <Route path="/" component={HOME} />
        <Route path="/users" component={CONTACT} />
    </Routes>
  </BrowserRouter>
);
